The first time you're reading this, you will only have one storage backend. It would be simple to just use that directly. To future proof for additional storage backends, let's assume we already have two: // paekli-core/src/storage.rs
trait DistributionCenter {} struct FileSystemStorage;
impl DistributionCenter for FileSystemStorage {} struct HttpClient;
impl DistributionCenter for HttpClient {} Let's try to write a simple function for creating a DistributionCenter: fn new_distribution_center(local: bool) -> ? { if local { FileSystemStorage } else { HttpClient }
} Hm, this doesn't quite work. There is no way for us to write a correct return type for this function, because the two possible values have different types. What we need is dynamic dispatch : fn new_distribution_center(local: bool) -> Box<dyn DistributionCenter> { if local { Box::new(FileSystemStorage) } else { Box::new(HttpClient) }
} How dynamic dispatch works The full explanation of dynamic dispatch can be found in chapter 17 of the Rust book . Here's a condensed version: The dyn keyword generates a table of function pointers ( vtable ) for each type that implements a certain trait. The vtable contains pointers to all methods of the trait and the drop method (destructor). A pointer to this vtable is then stored alongside a pointer to the actual value. Such a value is often referred to as a trait object . It uses the same mechanism of storing metadata with a pointer (fat pointer) as the slice type. This means that dynamic dispatch only works with some kind of pointer type, like Box<dyn Foo> or &dyn Foo. The memory size of the value behind the poiner is unknown at compile time. That's OK though, because the only thing you can do with such a value is call methods on it that actually do know its size. Finally, in your clients that need to access a distribution center, you can write: let center = new_distribution_center();
center.store();
center.retrieve();
